import React, { Fragment } from 'react';
import Die from './die'


function Row({ index, rowRolls }) {

    console.log(`printing row with ${rowRolls.length} columns`)

    let content = []
    for (let [index, value] of rowRolls.entries()) {
        console.log('send die index ',index+1)
        content.push(<td><Die key={index.toString()} id={index+1} roll={value}/></td>)
    }

    return (
        <div key={index}>
            {content}
        </div>
    )
}


export default Row
